oxy_webhelp_navlinks = {"tasks_getstarted-d4800e3088":{"topics":[{"title":"How do I assign to do items to other people?","shortdesc":"<p class=\"shortdesc\">You can assign to do items to another person or group of people.<\/p>","href":"tasks_assigntoothers_t.html","attributes":{"data-id":"tasks_assigntoothers_t"},"menu":{"hasChildren":false},"tocID":"tasks_assigntoothers_t-d4800e3099","topics":[]},{"title":"How do I create a repeating to do item?","shortdesc":"<p class=\"shortdesc\">You can create a to do item that repeats daily, weekly, monthly, yearly, or by a time period you specify.<\/p>","href":"tasks_repeating_t.html","attributes":{"data-id":"tasks_repeating_t"},"menu":{"hasChildren":false},"tocID":"tasks_repeating_t-d4800e3110","topics":[]},{"title":"What are categories and how can I use them in To Do?","shortdesc":"<p class=\"shortdesc\">Categories are labels that help you organize items and find them more easily. You can use categories to organize calendar entries, to do items, contacts, or groups. You can assign category colors, so entries in a category appear in a different color on your calendar.<\/p>","href":"tasks_categories_c.html","attributes":{"data-id":"tasks_categories_c"},"menu":{"hasChildren":false},"tocID":"tasks_categories_c-d4800e3121","topics":[]}]}};